import os
import streamlit as st
import pandas as pd
import requests
import joblib
import sys

# Loading the file
file_path = r'D:\Desktop Folders\PGD Batch 6\ml_final_project\tmbd_recom_sys.joblib'
if not os.path.exists(file_path):
    st.error(f"File not found: {file_path}")
    sys.exit(1)

# Load with memory mapping
try:
    tmdb, cosine_sim = joblib.load(file_path, mmap_mode='r')
except MemoryError:
    st.error("MemoryError: The file is too large to be loaded into memory.")
    sys.exit(1)

# Remove duplicates based on the 'name' column, keeping the first occurrence
tmdb = tmdb.drop_duplicates(subset='name', keep='first').reset_index(drop=True)
cosine_sim = cosine_sim[:len(tmdb), :len(tmdb)]


# Invalid name Lookups
def get_recommendations(name):
    if name not in tmdb['name'].values:
        st.error(f"Movie '{name}' not found in the dataset.")
        return pd.DataFrame()
    idx = tmdb[tmdb['name'] == name].index[0]
    sim_scores = list(enumerate(cosine_sim[idx]))
    sim_scores = sorted(sim_scores, key=lambda x: x[1], reverse=True)
    sim_scores = sim_scores[1:11]  # Exclude the movie itself
    movie_indices = [i[0] for i in sim_scores]
    return tmdb.iloc[movie_indices]

# Multiple Movies with the Same Name
def get_recommendations(name):
    # Use str.contains for more flexible matching (partial or case-insensitive)
    matches = tmdb[tmdb['name'].str.contains(name, case=False, regex=False)]
    
    # Check if there are any matches
    if matches.empty:
        st.error(f"Movie '{name}' not found in the dataset.")
        return pd.DataFrame()

    # Get the first valid index
    idx = matches.index[0]
    sim_scores = list(enumerate(cosine_sim[idx]))
    sim_scores = sorted(sim_scores, key=lambda x: x[1], reverse=True)
    sim_scores = sim_scores[1:11]
    movie_indices = [i[0] for i in sim_scores]
    return tmdb.iloc[movie_indices]

# Ensure Movie Name Accuracy
def get_recommendations(name):
    matches = tmdb[tmdb['name'].str.lower() == name.lower()]
    if matches.empty:
        st.error(f"Movie '{name}' not found in the dataset.")
        return pd.DataFrame()
    if len(matches) > 1:
        st.warning(f"Multiple movies found with the name '{name}'. Showing results for the first one.")
    idx = matches.index[0]  # Take the first match
    sim_scores = list(enumerate(cosine_sim[idx]))
    sim_scores = sorted(sim_scores, key=lambda x: x[1], reverse=True)
    sim_scores = sim_scores[1:11]
    movie_indices = [i[0] for i in sim_scores]
    return tmdb.iloc[movie_indices]

# Function to get movie recommendations
def get_recommendations(name):
    idx = tmdb[tmdb['name'] == name].index[0]
    sim_scores = list(enumerate(cosine_sim[idx]))
    sim_scores = sorted(sim_scores, key=lambda x: x[1], reverse=True)
    sim_scores = sim_scores[1:11]
    movie_indices = [i[0] for i in sim_scores]
    return tmdb.iloc[movie_indices]

