def fetch_poster(id):
    # Check if the movie exists in the DataFrame
    if id not in tmdb['id'].values:
        return "https://via.placeholder.com/500x750?text=No+Poster+Available"
    
    # Get the movie name
    movie_name = tmdb[tmdb['id'] == id]['name'].values[0]
    
    # Check if the movie has a custom poster
    if movie_name in custom_posters:
        return custom_posters[movie_name]
    
    # Fetch poster path from the API
    api_key = 'd94a462aa6a6068591ba7b85b7eca533'
    url = f'https://api.themoviedb.org/3/movie/{id}?api_key={api_key}'
    response = requests.get(url)
    
    # Check if the request was successful
    if response.status_code != 200:
        return "https://via.placeholder.com/500x750?text=No+Poster+Available"
    
    data = response.json()
    
    # Check if 'poster_path' exists in the response
    if 'poster_path' in data and data['poster_path']:
        poster_path = data['poster_path']
        full_path = f"https://image.tmdb.org/t/p/w500{poster_path}"
        return full_path
    else:
        # Check if the 'poster_path' column exists in the DataFrame and is not null
        if 'poster_path' in tmdb.columns:
            poster_path = tmdb[tmdb['id'] == id]['poster_path'].values[0]
            if pd.isnull(poster_path):
                return "https://via.placeholder.com/500x750?text=No+Poster+Available"
            else:
                return "https://image.tmdb.org/t/p/original" + poster_path
        else:
            return "https://via.placeholder.com/500x750?text=No+Poster+Available"

# Streamlit UI
st.title("Welcome to Hybrid Movie Recommendation System!!")

selected_movie = st.selectbox("Select a movie:", tmdb['name'].values)

if st.button('Recommend'):
    recommendations = get_recommendations(selected_movie)
    st.write("Movies that you might like to watch:")
    
    displayed_movies = set()

    # Create a 2x5 grid layout
    for i in range(0, 10, 5):
        cols = st.columns(5)
        for col, j in zip(cols, range(i, i+5)):
            if j < len(recommendations):
                tmdb_name = recommendations.iloc[j]['name']
                tmdb_id = recommendations.iloc[j]['id']
                
                # Check if the movie name has already been displayed
                if tmdb_name not in displayed_movies:
                    poster_url = fetch_poster(tmdb_id)
                    with col:
                        st.image(poster_url, width=130)
                        st.write(tmdb_name)
                    displayed_movies.add(tmdb_name)